import React, { Children } from 'react';
import MyDocument from './document';

function InvoiceRoot({btnClicked}) {
    useEffect(()=>{
        console.log("InvoiceRoot",btnClicked);
       },[btnClicked])
    return (
        <div style={{display:'grid',justifyContent:'center', backgroundColor:'white'}}>
        <MyDocument btnClicked={btnClicked}/>
        </div>
    );
}

export default InvoiceRoot;
